// Preprocessed test image data (license plate)
// Original image: EAS2049_jpg.rf.1d872583ff3e86d7e2a0419d770ead77.jpg
// Preprocessed to: 416x416x3 float32 array

export const TEST_IMAGE_DATA = {
  shape: [416, 416, 3],
  dtype: 'float32',
  base64: ``,
  description: 'License plate test image (EAS2049)',
  expectedDetection: 'license_plate'
};

export function decodeTestImageData() {
  // Decode base64 to Float32Array
  const binaryString = atob(TEST_IMAGE_DATA.base64);
  const bytes = new Uint8Array(binaryString.length);
  for (let i = 0; i < binaryString.length; i++) {
    bytes[i] = binaryString.charCodeAt(i);
  }
  return new Float32Array(bytes.buffer);
}
